import React, { Component } from 'react';
import TopNavRightIcon from './TopNavRightIcon';
import TopNavRightSelect from './TopNavRightSelect';


class TopNavRight extends Component {
            
    constructor() {
        super()
        this.state = {
            IconInfo: [
                { href: "tel:01028496209", title: "Call me", id: "mobile", media: "01028496209", className: "fas fa-phone-alt" },
                { href: "mailto:info@yourdomain.com", title: "Mail", media: "info@yourdomain.com", className: "far fa-envelope" }
            ]
        }
    }
    
    mapping(x) {
        const members=x.map(member =>
            <TopNavRightIcon
                href={member.href}
                title={member.title}
                id={member.id}
                media={member.media}
                className={member.className}
            />
    )
            return(members)
    }

    render() {
            return (
            <div className="col-lg-6 col-md-6 col-sm-12 col-xs-12">
                <ul className="list-inline2">
                    <li><select id="basic" className="selectpicker show-tick form-control" placeholder="تسجيل الدخول" title="register">
                        <TopNavRightSelect option="تسجيل الدخول" />
                        <TopNavRightSelect option="الاشتراك"/> 
                    </select>
                        <i className="fas fa-users"></i>
                    </li>
                    <li>
                        {mapping(this.state.IconInfo)}
                    </li>
                </ul>
            </div>
        )
        }
}
export default TopNavRight;
